Create Table CARNAVAL  (
	ID_CARNAVAL Bigint NOT NULL,
	ANO Integer NOT NULL,
	ATIVO Smallint NOT NULL,
	DATA_HORA_ENCERRAMENTO Timestamp NOT NULL,
Constraint pk_CARNAVAL Primary Key (ID_CARNAVAL)
);

Create Table DIA  (
	ID_DIA Bigint NOT NULL,
	ID_CARNAVAL Bigint NOT NULL,
	DATA Timestamp NOT NULL,
Constraint pk_DIA Primary Key (ID_DIA)
);

Create Table UNIDADE  (
